script: |
  super -f text -I q7500.spq | sort > q7500.out

inputs:
  - name: q7500.spq
    data: |
      SELECT DISTINCT + + 17 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN + col0 * - col0 AND - CAST ( NULL AS INTEGER ) - col0;
  - name: tab1

outputs:
  - name: q7500.out
    data: |
